import React from 'react';
import Slider from '../Slider'
import './';

export default function Registration() {
  return (
    <div>
      <Slider> 
        <div className='slider'> Hello this is slider </div>
      </Slider>
      <form>
        <input type='text' placeholder='Email'/>
        <input type='text' placeholder='Class'/>
        <input type='text' placeholder='Email'/>
      </form>
    </div>
  )
}
